   const handleLogout = (e) => {
    dispatch({type:"LOGOUT"});
  }


  return (
    <div className={"topbar " + (menuOpen && "active")}>
      <div className="wrapper">
        <div className="left">
          <a href="#123" className="logo">
            Logo.
          </a>
          <div className="itemContainer">
            <Person className="icon" /> <span>+141141212421</span>
          </div>
